import { ReactNode } from 'react';
import { Cell, IconContainer, Section } from '@telegram-apps/telegram-ui';

import { Icon28Heart } from '@telegram-apps/telegram-ui/dist/icons/28/heart';
import { Icon24ChevronRight } from '@telegram-apps/telegram-ui/dist/icons/24/chevron_right';

type CellProps = {
  id: number;
  left: ReactNode;
  right: ReactNode;
  text: string;
  subtitle: string;
}

const cells: CellProps[] = [
  {
    id: 1,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Учёба',
    subtitle: 'Форум • кружки • материалы',
  },
  {
    id: 2,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Студ. актив',
    subtitle: 'Клубы • события • движ',
  },
  {
    id: 3,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Преподаватели',
    subtitle: '',
  },
  {
    id: 4,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Библиотека',
    subtitle: '',
  },
  {
    id: 5,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Свободные аудитории',
    subtitle: '',
  },
];

// Wrapper component for fixed height cells
const FixedHeightCell = ({ cell }: { cell: CellProps }) => (
  <div className="h-16 flex items-center">
    <Cell
      key={cell.id}
      before={<IconContainer>{cell.left}</IconContainer>}
      after={<IconContainer>{cell.right}</IconContainer>}
      subtitle={cell.subtitle}
      className="w-full"
    >
      {cell.text}
    </Cell>
  </div>
);

export const CellMainSection = () => (
  <Section>
    {cells.map((cell) => (
      <FixedHeightCell key={cell.id} cell={cell} />
    ))}
  </Section>
);

const faqCell: CellProps = {
  id: 6,
  left: <Icon28Heart />,
  right: <Icon24ChevronRight />,
  text: 'ЧаВо',
  subtitle: 'Абитуриентам • студентам',
};

export const CellFAQSection = () => (
  <Section>
    <FixedHeightCell cell={faqCell} />
  </Section>
);
